import { Container, ListGroup } from 'reactstrap'
import RestListItem from './RestListItem'

const RestList = ({rest}) => {
  return (
    <Container>
      <h1 className='text-center my-5'> 경기도 맛집 리스트 </h1>
      <ListGroup>
        {
          rest.map(c=>(
            <RestListItem 
              id = {c[0].id}
              sigun={c[0].sigun}
              title={c[0].title}
              tel={c[0].tel}
              title_food={c[0].title_food}
              zip={c[0].zip}
              address={c[0].address}
              address_old={c[0].address_old}
              lat={c[0].lat}
              lng={c[0].lng}
              radius={c[0].radius}/>
          ))
        }
        {/*  */}
      </ListGroup>
    </Container>
  )
}

export default RestList
